import Header from "./Component/14 ReactRoutine/Header";
// import Navbar from "./Component/14 ReactRoutine/Navbar";
let App = () => {
  return (
    <div className="App">
       <BrowserRouter>
      <Navbar />
      <Switch>
        <Route path="/" element={<Home />} />
        <Route path="/about" element={<About />} />
        <Route path="/service" element={<Service />} />
        <Route path="/contact" element={<Contact />} />
      </Switch>
    </BrowserRouter>
    </div>
  );
};

export default App;
